  "WindowBase" : 
    "name" : "WindowBase"
    "qualifiedname" : "dart.dom.html.WindowBase"
    "comment" : "<p>An object representing the top-level context object for web scripting.</p> <p>In a web browser, a <code>Window</code> object represents the actual browser window. In a multi-tabbed browser, each tab has its own <code>Window</code> object. A <code>Window</code> is the container that displays a <code>Document</code>'s content. All web scripting happens within the context of a <code>Window</code> object.</p> <p><strong>Note:</strong> This class represents any window, whereas <code>Window</code> is used to access the properties and content of the current window.</p> <p>See also:</p><ul><li><a href=\"https://developer.mozilla.org/en-US/docs/DOM/window\">DOM Window</a> from MDN.</li><li><a href=\"http://www.w3.org/TR/Window/\">Window</a> from the W3C.</li></ul>"
    "superclass" : "dart.core.Object"
    "abstract" : "true"
    "typedef" : "false"
    "implements" : 
    "variables" : 
    "methods" : 
      "location" : 
        "name" : "location"
        "qualifiedname" : "dart.dom.html.WindowBase.location"
        "comment" : "<p>The current location of this window.</p> <pre><code>Location currentLocation = window.location; print(currentLocation.href); // 'http://www.example.com:80/' </code></pre>"
        "type" : "getter"
        "static" : "false"
        "return" : "dart.dom.html.LocationBase"
        "parameters" : 
      "history" : 
        "name" : "history"
        "qualifiedname" : "dart.dom.html.WindowBase.history"
        "comment" : ""
        "type" : "getter"
        "static" : "false"
        "return" : "dart.dom.html.HistoryBase"
        "parameters" : 
      "closed" : 
        "name" : "closed"
        "qualifiedname" : "dart.dom.html.WindowBase.closed"
        "comment" : "<p>Indicates whether this window has been closed.</p> <pre><code>print(window.closed); // 'false' window.close(); print(window.closed); // 'true' </code></pre>"
        "type" : "getter"
        "static" : "false"
        "return" : "dart.core.bool"
        "parameters" : 
      "opener" : 
        "name" : "opener"
        "qualifiedname" : "dart.dom.html.WindowBase.opener"
        "comment" : "<p>A reference to the window that opened this one.</p> <pre><code>Window thisWindow = window; WindowBase otherWindow = thisWindow.open('http://www.example.com/', 'foo'); print(otherWindow.opener == thisWindow); // 'true' </code></pre>"
        "type" : "getter"
        "static" : "false"
        "return" : "dart.dom.html.WindowBase"
        "parameters" : 
      "parent" : 
        "name" : "parent"
        "qualifiedname" : "dart.dom.html.WindowBase.parent"
        "comment" : "<p>A reference to the parent of this window.</p> <p>If this <code>WindowBase</code> has no parent, <code>parent</code> will return a reference to the <code>WindowBase</code> itself.</p> <pre><code>IFrameElement myIFrame = new IFrameElement(); window.document.body.elements.add(myIFrame); print(myIframe.contentWindow.parent == window) // 'true'  print(window.parent == window) // 'true' </code></pre>"
        "type" : "getter"
        "static" : "false"
        "return" : "dart.dom.html.WindowBase"
        "parameters" : 
      "top" : 
        "name" : "top"
        "qualifiedname" : "dart.dom.html.WindowBase.top"
        "comment" : "<p>A reference to the topmost window in the window hierarchy.</p> <p>If this <code>WindowBase</code> is the topmost <code>WindowBase</code>, <code>top</code> will return a reference to the <code>WindowBase</code> itself.</p> <pre><code>// Add an IFrame to the current window. IFrameElement myIFrame = new IFrameElement(); window.document.body.elements.add(myIFrame);  // Add an IFrame inside of the other IFrame. IFrameElement innerIFrame = new IFrameElement(); myIFrame.elements.add(innerIFrame);  print(myIframe.contentWindow.top == window) // 'true' print(innerIFrame.contentWindow.top == window) // 'true'  print(window.top == window) // 'true' </code></pre>"
        "type" : "getter"
        "static" : "false"
        "return" : "dart.dom.html.WindowBase"
        "parameters" : 
      "close" : 
        "name" : "close"
        "qualifiedname" : "dart.dom.html.WindowBase.close"
        "comment" : "<p>Closes the window.</p> <p>This method should only succeed if the <code>WindowBase</code> object is <strong>script-closeable</strong> and the window calling <code>close</code> is allowed to navigate the window.</p> <p>A window is script-closeable if it is either a window that was opened by another window, or if it is a window with only one document in its history.</p> <p>A window might not be allowed to navigate, and therefore close, another window due to browser security features.</p> <pre><code>var other = window.open('http://www.example.com', 'foo'); // Closes other window, as it is script-closeable. other.close(); print(other.closed()); // 'true'  window.location('http://www.mysite.com', 'foo'); // Does not close this window, as the history has changed. window.close(); print(window.closed()); // 'false' </code></pre> <p>See also:</p><ul><li><a href=\"http://www.w3.org/TR/html5/browsers.html#dom-window-close\">Window close discussion</a> from the W3C</li></ul>"
        "type" : "method"
        "static" : "false"
        "return" : "void"
        "parameters" : 
      "postMessage" : 
        "name" : "postMessage"
        "qualifiedname" : "dart.dom.html.WindowBase.postMessage"
        "comment" : ""
        "type" : "method"
        "static" : "false"
        "return" : "void"
        "parameters" : 
          "message" : 
            "name" : "message"
            "qualifiedname" : "dart.dom.html.WindowBase.postMessage#message"
