  "CanvasImageSource" : 
    "name" : "CanvasImageSource"
    "qualifiedname" : "dart.dom.html.CanvasImageSource"
    "comment" : "<p>An object that can be drawn to a <code>CanvasRenderingContext2D</code> object with <code>CanvasRenderingContext2D.drawImage</code>, <code>CanvasRenderingContext2D.drawImageToRect</code>, <code>CanvasRenderingContext2D.drawImageScaled</code>, or <code>CanvasRenderingContext2D.drawImageScaledFromSource</code>.</p> <p>If the CanvasImageSource is an <code>ImageElement</code> then the element's image is used. If the <code>ImageElement</code> is an animated image, then the poster frame is used. If there is no poster frame, then the first frame of animation is used.</p> <p>If the CanvasImageSource is a <code>VideoElement</code> then the frame at the current playback position is used as the image.</p> <p>If the CanvasImageSource is a <code>CanvasElement</code> then the element's bitmap is used.</p> <p><strong> Note: </strong> Currently, all versions of Internet Explorer do not support drawing a VideoElement to a canvas. Also, you may experience problems drawing a video to a canvas in Firefox if the source of the video is a data URL.</p> <p>See also:</p><ul><li> <p><a href=\"http://www.whatwg.org/specs/web-apps/current-work/multipage/the-canvas-element.html#image-sources-for-2d-rendering-contexts\">CanvasImageSource</a> from the WHATWG.</p></li><li> <p><a href=\"http://www.whatwg.org/specs/web-apps/current-work/multipage/the-canvas-element.html#dom-context-2d-drawimage\">drawImage</a> from the WHATWG.</p></li></ul>"
