  "WebSocket" : 
    "name" : "WebSocket"
    "qualifiedname" : "dart.dom.html.WebSocket"
    "comment" : "<p>Use the WebSocket interface to connect to a WebSocket, and to send and receive data on that WebSocket.</p> <p>To use a WebSocket in your web app, first create a WebSocket object, passing the WebSocket URL as an argument to the constructor.</p> <pre><code>var webSocket = new WebSocket('ws://127.0.0.1:1337/ws'); </code></pre> <p>To send data on the WebSocket, use the <code>send</code> method.</p> <pre><code>if (webSocket != null &amp;&amp; webSocket.readyState == WebSocket.OPEN) {   webSocket.send(data); } else {   print('WebSocket not connected, message $data not sent'); } </code></pre> <p>To receive data on the WebSocket, register a listener for message events.</p> <pre><code>webSocket.onMessage.listen((MessageEvent e) {   receivedData(e.data); }); </code></pre> <p>The message event handler receives a <code>MessageEvent</code> object as its sole argument. You can also define open, close, and error handlers, as specified by <code>WebSocketEvents</code>.</p> <p>For more information, see the <a href=\"http://www.dartlang.org/docs/library-tour/#html-websockets\">WebSockets</a> section of the library tour and <a href=\"http://www.html5rocks.com/en/tutorials/websockets/basics/\">Introducing WebSockets</a>, an HTML5Rocks.com tutorial.</p>"
