  "CustomBindingSyntax" : 
    "name" : "CustomBindingSyntax"
    "qualifiedname" : "dart.dom.html.CustomBindingSyntax"
    "comment" : "<p>Model-Driven Views (MDV)'s native features enables a wide-range of use cases, but (by design) don't attempt to implement a wide array of specialized behaviors.</p> <p>Enabling these features in MDV is a matter of implementing and registering an MDV Custom Syntax. A Custom Syntax is an object which contains one or more delegation functions which implement specialized behavior. This object is registered with MDV via <code>TemplateElement.syntax</code>:</p> <p>HTML:</p> <pre><code>&lt;template bind syntax=\"MySyntax\"&gt;   {{ What!Ever('crazy')-&gt;thing^^^I+Want(data) }} &lt;/template&gt; </code></pre> <p>Dart:</p> <pre><code>class MySyntax extends CustomBindingSyntax {   getBinding(model, path, name, node) {     // The magic happens here!   } }  ...  TemplateElement.syntax['MySyntax'] = new MySyntax(); </code></pre> <p>See <a href=\"https://github.com/polymer-project/mdv/blob/master/docs/syntax.md\">https://github.com/polymer-project/mdv/blob/master/docs/syntax.md</a> for more information about Custom Syntax.</p>"
    "superclass" : "dart.core.Object"
    "abstract" : "true"
    "typedef" : "false"
    "implements" : 
    "variables" : 
    "methods" : 
      "getBinding" : 
        "name" : "getBinding"
        "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getBinding"
        "comment" : "<p>This syntax method allows for a custom interpretation of the contents of mustaches (<code>{{</code> ... <code>}}</code>).</p> <p>When a template is inserting an instance, it will invoke this method for each mustache which is encountered. The function is invoked with four arguments:</p><ul><li><code>model</code>: The data context for which this instance is being created.</li><li><code>path</code>: The text contents (trimmed of outer whitespace) of the mustache.</li><li> <p><code>name</code>: The context in which the mustache occurs. Within element   attributes, this will be the name of the attribute. Within text,   this will be 'text'.</p></li><li><code>node</code>: A reference to the node to which this binding will be created.</li></ul> <p>If the method wishes to handle binding, it is required to return an object which has at least a <code>value</code> property that can be observed. If it does, then MDV will call [Node.bind on the node:</p> <pre><code>node.bind(name, retval, 'value'); </code></pre> <p>If the 'getBinding' does not wish to override the binding, it should return null.</p>"
        "type" : "method"
        "static" : "false"
        "return" : "dynamic"
        "parameters" : 
          "model" : 
            "name" : "model"
            "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getBinding#model"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dynamic"
            "value" : "null"
          "path" : 
            "name" : "path"
            "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getBinding#path"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dart.core.String"
            "value" : "null"
          "name" : 
            "name" : "name"
            "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getBinding#name"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dynamic"
            "value" : "null"
          "node" : 
            "name" : "node"
            "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getBinding#node"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dynamic"
            "value" : "null"
      "getInstanceModel" : 
        "name" : "getInstanceModel"
        "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getInstanceModel"
        "comment" : "<p>This syntax method allows a syntax to provide an alterate model than the one the template would otherwise use when producing an instance.</p> <p>When a template is about to create an instance, it will invoke this method The function is invoked with two arguments:</p><ul><li> <p><code>template</code>: The template element which is about to create and insert an   instance.</p></li><li><code>model</code>: The data context for which this instance is being created.</li></ul> <p>The template element will always use the return value of <code>getInstanceModel</code> as the model for the new instance. If the syntax does not wish to override the value, it should simply return the <code>model</code> value it was passed.</p>"
        "type" : "method"
        "static" : "false"
        "return" : "dynamic"
        "parameters" : 
          "template" : 
            "name" : "template"
            "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getInstanceModel#template"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dart.dom.html.Element"
            "value" : "null"
          "model" : 
            "name" : "model"
            "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getInstanceModel#model"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dynamic"
            "value" : "null"
      "getInstanceFragment" : 
        "name" : "getInstanceFragment"
        "qualifiedname" : "dart.dom.html.CustomBindingSyntax.getInstanceFragment"
        "comment" : "<p>This syntax method allows a syntax to provide an alterate expansion of the <code>template</code> contents. When the template wants to create an instance, it will call this method with the template element.</p> <p>By default this will call <code>template.createInstance()</code>.</p>"
