  "Storage" : 
    "name" : "Storage"
    "qualifiedname" : "dart.dom.html.Storage"
    "comment" : "<p>The type used by the <code>Window.localStorage</code> and <code>Window.sessionStorage</code> properties. Storage is implemented as a Map&lt;String, String>.</p> <p>To store and get values, use Dart's built-in map syntax:</p> <pre><code>window.localStorage['key1'] = 'val1'; window.localStorage['key2'] = 'val2'; window.localStorage['key3'] = 'val3'; assert(window.localStorage['key3'] == 'val3'); </code></pre> <p>You can use <a href=\"http://api.dartlang.org/dart_core/Map.html\">Map</a> APIs such as containsValue(), clear(), and length:</p> <pre><code>assert(window.localStorage.containsValue('does not exist') == false); window.localStorage.clear(); assert(window.localStorage.length == 0); </code></pre> <p>For more examples of using this API, see <a href=\"http://code.google.com/p/dart/source/browse/branches/bleeding_edge/dart/tests/html/localstorage_test.dart\">localstorage_test.dart</a>. For details on using the Map API, see the <a href=\"http://www.dartlang.org/docs/library-tour/#maps-aka-dictionaries-or-hashes\">Maps</a> section of the library tour.</p>"
