        "name" : "getUserMedia"
        "qualifiedname" : "dart.dom.html.Navigator.getUserMedia"
        "comment" : "<p>Gets a stream (video and or audio) from the local computer.</p> <p>Use <code>MediaStream.supported</code> to check if this is supported by the current platform. The arguments <code>audio</code> and <code>video</code> default to <code>false</code> (stream does not use audio or video, respectively).</p> <p>Simple example usage:</p> <pre><code>window.navigator.getUserMedia(audio: true, video: true).then((stream) {   var video = new VideoElement()     ..autoplay = true     ..src = Url.createObjectUrl(stream);   document.body.append(video); }); </code></pre> <p>The user can also pass in Maps to the audio or video parameters to specify  mandatory and optional constraints for the media stream. Not passing in a  map, but passing in <code>true</code> will provide a MediaStream with audio or  video capabilities, but without any additional constraints. The particular constraint names for audio and video are still in flux, but as of this  writing, here is an example providing more constraints.</p> <pre><code>window.navigator.getUserMedia(     audio: true,      video: {'mandatory':                 { 'minAspectRatio': 1.333, 'maxAspectRatio': 1.334 },             'optional':                 [{ 'minFrameRate': 60 },                 { 'maxWidth': 640 }] }); </code></pre> <p>See also: * <code>MediaStream.supported</code></p>"
