  "HttpRequest" : 
    "name" : "HttpRequest"
    "qualifiedname" : "dart.dom.html.HttpRequest"
    "comment" : "<p>A utility for retrieving data from a URL.</p> <p>HttpRequest can be used to obtain data from http, ftp, and file protocols.</p> <p>For example, suppose we're developing these API docs, and we wish to retrieve the HTML of the top-level page and print it out. The easiest way to do that would be:</p> <pre><code>HttpRequest.getString('http://api.dartlang.org').then((response) {   print(response); }); </code></pre> <p><strong>Important</strong>: With the default behavior of this class, your code making the request should be served from the same origin (domain name, port, and application layer protocol) as the URL you are trying to access with HttpRequest. However, there are ways to <a href=\"http://www.dartlang.org/articles/json-web-service/#note-on-jsonp\">get around this restriction</a>.</p> <p>See also:</p><ul><li><a href=\"http://www.dartlang.org/articles/json-web-service/#getting-data\">Dart article on using HttpRequests</a></li><li><a href=\"https://developer.mozilla.org/en-US/docs/DOM/XMLHttpRequest\">JS XMLHttpRequest</a></li><li><a href=\"https://developer.mozilla.org/en-US/docs/DOM/XMLHttpRequest/Using_XMLHttpRequest\">Using XMLHttpRequest</a></li></ul>"
    "superclass" : "dart.dom.html.EventTarget"
    "abstract" : "false"
    "typedef" : "false"
    "implements" : 
    "variables" : 
      "abortEvent" : 
