        "type" : "dart.core.int"
      "readyState" : 
        "name" : "readyState"
        "qualifiedname" : "dart.dom.html.HttpRequest.readyState"
        "comment" : "<p>Indicator of the current state of the request:</p><table>   <tr>     <td>Value</td>     <td>State</td>     <td>Meaning</td>   </tr>   <tr>     <td>0</td>     <td>unsent</td>     <td><code>open()</code> has not yet been called</td>   </tr>   <tr>     <td>1</td>     <td>opened</td>     <td><code>send()</code> has not yet been called</td>   </tr>   <tr>     <td>2</td>     <td>headers received</td>     <td><code>sent()</code> has been called; response headers and <code>status</code> are available</td>   </tr>   <tr>     <td>3</td> <td>loading</td> <td><code>responseText</code> holds some data</td>   </tr>   <tr>     <td>4</td> <td>done</td> <td>request is complete</td>   </tr> </table>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.core.int"
      "response" : 
        "name" : "response"
        "qualifiedname" : "dart.dom.html.HttpRequest.response"
        "comment" : "<p>The data received as a reponse from the request.</p> <p>The data could be in the form of a <code>String</code>, <code>ArrayBuffer</code>, <code>Document</code>, <code>Blob</code>, or json (also a <code>String</code>). <code>null</code> indicates request failure.</p>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.core.Object"
      "responseText" : 
        "name" : "responseText"
        "qualifiedname" : "dart.dom.html.HttpRequest.responseText"
        "comment" : "<p>The response in string form or `null on failure.</p>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.core.String"
      "responseType" : 
        "name" : "responseType"
        "qualifiedname" : "dart.dom.html.HttpRequest.responseType"
        "comment" : "<p><code>String</code> telling the server the desired response format.</p> <p>Default is <code>String</code>. Other options are one of 'arraybuffer', 'blob', 'document', 'json', 'text'. Some newer browsers will throw NS<em>ERROR</em>DOM<em>INVALID</em>ACCESS_ERR if <code>responseType</code> is set while performing a synchronous request.</p> <p>See also: <a href=\"https://developer.mozilla.org/en-US/docs/DOM/XMLHttpRequest#responseType\">MDN responseType</a></p>"
        "final" : "false"
        "static" : "false"
        "type" : "dart.core.String"
      "responseXml" : 
        "name" : "responseXml"
        "qualifiedname" : "dart.dom.html.HttpRequest.responseXml"
        "comment" : "<p>The request response, or null on failure.</p> <p>The response is processed as <code>text/xml</code> stream, unless responseType = 'document' and the request is synchronous.</p>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.dom.html.Document"
      "status" : 
        "name" : "status"
        "qualifiedname" : "dart.dom.html.HttpRequest.status"
        "comment" : "<p>The http result code from the request (200, 404, etc). See also: <a href=\"http://en.wikipedia.org/wiki/List_of_HTTP_status_codes\">Http Status Codes</a></p>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.core.int"
      "statusText" : 
        "name" : "statusText"
        "qualifiedname" : "dart.dom.html.HttpRequest.statusText"
        "comment" : "<p>The request response string (such as \\\"200 OK\\\"). See also: <a href=\"http://en.wikipedia.org/wiki/List_of_HTTP_status_codes\">Http Status Codes</a></p>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.core.String"
      "upload" : 
        "name" : "upload"
        "qualifiedname" : "dart.dom.html.HttpRequest.upload"
        "comment" : "<p><code>EventTarget</code> that can hold listeners to track the progress of the request. The events fired will be members of <code>HttpRequestUploadEvents</code>.</p>"
        "final" : "true"
        "static" : "false"
        "type" : "dart.dom.html.HttpRequestUpload"
      "withCredentials" : 
        "name" : "withCredentials"
        "qualifiedname" : "dart.dom.html.HttpRequest.withCredentials"
        "comment" : "<p>True if cross-site requests should use credentials such as cookies or authorization headers; false otherwise.</p> <p>This value is ignored for same-site requests.</p>"
        "final" : "false"
        "static" : "false"
        "type" : "dart.core.bool"
    "methods" : 
      "getString" : 
        "name" : "getString"
        "qualifiedname" : "dart.dom.html.HttpRequest.getString"
        "comment" : "<p>Creates a URL get request for the specified <code>url</code>.</p> <p>The server response must be a <code>text/</code> mime type for this request to succeed.</p> <p>This is similar to <code>request</code> but specialized for HTTP GET requests which return text content.</p> <p>See also:</p><ul><li><code>request</code></li></ul>"
        "type" : "method"
        "static" : "true"
        "return" : "dart.async.Future"
        "parameters" : 
