  "Events" : 
    "name" : "Events"
    "qualifiedname" : "dart.dom.html.Events"
    "comment" : "<p>Base class that supports listening for and dispatching browser events.</p> <p>Normally events are accessed via the Stream getter:</p> <pre><code>element.onMouseOver.listen((e) =&gt; print('Mouse over!')); </code></pre> <p>To access bubbling events which are declared on one element, but may bubble up to another element type (common for MediaElement events):</p> <pre><code>MediaElement.pauseEvent.forTarget(document.body).listen(...); </code></pre> <p>To useCapture on events:</p> <pre><code>Element.keyDownEvent.forTarget(element, useCapture: true).listen(...); </code></pre> <p>Custom events can be declared as:</p> <p>   class DataGenerator {</p> <pre><code> static EventStreamProvider&lt;Event&gt; dataEvent =      new EventStreamProvider('data'); </code></pre> <p>   }</p> <p>Then listeners should access the event with:</p> <pre><code>DataGenerator.dataEvent.forTarget(element).listen(...); </code></pre> <p>Custom events can also be accessed as:</p> <pre><code>element.on['some_event'].listen(...); </code></pre> <p>This approach is generally discouraged as it loses the event typing and some DOM events may have multiple platform-dependent event names under the covers. By using the standard Stream getters you will get the platform specific event name automatically.</p>"
