    "methods" : 
      "Element.html" : 
        "name" : "Element.html"
        "qualifiedname" : "dart.dom.html.Element.Element.html"
        "comment" : "<p>Creates an HTML element from a valid fragment of HTML.</p> <p>The <code>html</code> fragment must represent valid HTML with a single element root, which will be parsed and returned.</p> <p>Important: the contents of <code>html</code> should not contain any user-supplied data. Without strict data validation it is impossible to prevent script injection exploits.</p> <p>It is instead recommended that elements be constructed via <code>Element.tag</code> and text be added via <code>text</code>.</p> <pre><code>var element = new Element.html('&lt;div class=\"foo\"&gt;content&lt;/div&gt;'); </code></pre>"
        "type" : "constructor"
        "static" : "false"
        "return" : "dart.dom.html.Element"
        "parameters" : 
          "html" : 
            "name" : "html"
            "qualifiedname" : "dart.dom.html.Element.Element.html#html"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dart.core.String"
            "value" : "null"
      "Element.tag" : 
        "name" : "Element.tag"
        "qualifiedname" : "dart.dom.html.Element.Element.tag"
        "comment" : "<p>Creates the HTML element specified by the tag name.</p> <p>This is similar to <code>Document.createElement</code>. <code>tag</code> should be a valid HTML tag name. If <code>tag</code> is an unknown tag then this will create an <code>UnknownElement</code>.</p> <pre><code>var divElement = new Element.tag('div'); print(divElement is DivElement); // 'true' var myElement = new Element.tag('unknownTag'); print(myElement is UnknownElement); // 'true' </code></pre> <p>For standard elements it is more preferable to use the type constructors:</p> <pre><code>var element = new DivElement(); </code></pre> <p>See also:</p><ul><li><code>isTagSupported</code></li></ul>"
        "type" : "constructor"
        "static" : "false"
        "return" : "dart.dom.html.Element"
        "parameters" : 
          "tag" : 
            "name" : "tag"
            "qualifiedname" : "dart.dom.html.Element.Element.tag#tag"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dart.core.String"
            "value" : "null"
      "attributes" : 
        "name" : "attributes"
        "qualifiedname" : "dart.dom.html.Element.attributes"
        "comment" : "<p>All attributes on this element.</p> <p>Any modifications to the attribute map will automatically be applied to this element.</p> <p>This only includes attributes which are not in a namespace (such as 'xlink:href'), additional attributes can be accessed via <code>getNamespacedAttributes</code>.</p>"
        "type" : "getter"
        "static" : "false"
        "return" : "dart.core.Map"
        "parameters" : 
      "attributes=" : 
        "name" : "attributes="
        "qualifiedname" : "dart.dom.html.Element.attributes="
        "comment" : ""
        "type" : "setter"
        "static" : "false"
        "return" : "void"
        "parameters" : 
          "value" : 
            "name" : "value"
            "qualifiedname" : "dart.dom.html.Element.attributes=#value"
            "optional" : "false"
            "named" : "false"
            "default" : "false"
            "type" : "dart.core.Map"
            "value" : "null"
      "children" : 
        "name" : "children"
        "qualifiedname" : "dart.dom.html.Element.children"
        "comment" : "<p>List of the direct children of this element.</p> <p>This collection can be used to add and remove elements from the document.</p> <pre><code>var item = new DivElement(); item.text = 'Something'; document.body.children.add(item) // Item is now displayed on the page. for (var element in document.body.children) {   element.style.background = 'red'; // Turns every child of body red. } </code></pre>"
        "type" : "getter"
        "static" : "false"
