      "queryAll" : 
        "name" : "queryAll"
        "qualifiedname" : "dart.dom.html.Element.queryAll"
        "comment" : "<p>Finds all descendent elements of this element that match the specified group of selectors.</p> <p><code>selectors</code> should be a string using CSS selector syntax.</p> <pre><code>var items = element.query('.itemClassName'); </code></pre>"
