      "classes" : 
        "name" : "classes"
        "qualifiedname" : "dart.dom.html.Element.classes"
        "comment" : "<p>The set of CSS classes applied to this element.</p> <p>This set makes it easy to add, remove or toggle the classes applied to this element.</p> <pre><code>element.classes.add('selected'); element.classes.toggle('isOnline'); element.classes.remove('selected'); </code></pre>"
