            "value" : "null"
      "dataset" : 
        "name" : "dataset"
        "qualifiedname" : "dart.dom.html.Element.dataset"
        "comment" : "<p>Allows access to all custom data attributes (data-*) set on this element.</p> <p>The keys for the map must follow these rules:</p><ul><li>The name must not begin with 'xml'.</li><li>The name cannot contain a semi-colon (';').</li><li>The name cannot contain any capital letters.</li></ul> <p>Any keys from markup will be converted to camel-cased keys in the map.</p> <p>For example, HTML specified as:</p> <pre><code>&lt;div data-my-random-value='value'&gt;&lt;/div&gt; </code></pre> <p>Would be accessed in Dart as:</p> <pre><code>var value = element.dataset['myRandomValue']; </code></pre> <p>See also:</p><ul><li><a href=\"http://www.w3.org/TR/html5/global-attributes.html#custom-data-attribute\">Custom data attributes</a></li></ul>"
        "type" : "getter"
