        "comment" : "<p>Draws an image from a CanvasImageSource to an area of this canvas.</p> <p>The image will be drawn to an area of this canvas defined by <code>destRect</code>. <code>sourceRect</code> defines the region of the source image that is drawn. If <code>sourceRect</code> is not provided, then the entire rectangular image from <code>source</code> will be drawn to this context.</p> <p>If the image is larger than canvas will allow, the image will be clipped to fit the available space.</p> <pre><code>CanvasElement canvas = new CanvasElement(width: 600, height: 600); CanvasRenderingContext2D ctx = canvas.context2D; ImageElement img = document.query('img'); img.width = 100; img.height = 100;  // Scale the image to 20x20. ctx.drawImageToRect(img, new Rect(50, 50, 20, 20));  VideoElement video = document.query('video'); video.width = 100; video.height = 100; // Take the middle 20x20 pixels from the video and stretch them. ctx.drawImageToRect(video, new Rect(50, 50, 100, 100),     sourceRect: new Rect(40, 40, 20, 20));  // Draw the top 100x20 pixels from the otherCanvas. CanvasElement otherCanvas = document.query('canvas'); ctx.drawImageToRect(otherCanvas, new Rect(0, 0, 100, 20),     sourceRect: new Rect(0, 0, 100, 20)); </code></pre> <p>See also:</p><ul><li> <p><code>CanvasImageSource</code> for more information on what data is retrieved from <code>source</code>.</p></li><li> <p><a href=\"http://www.whatwg.org/specs/web-apps/current-work/multipage/the-canvas-element.html#dom-context-2d-drawimage\">drawImage</a> from the WHATWG.</p></li></ul>"
