    "qualifiedname" : "dart.dom.html.CanvasPattern"
    "comment" : "<p>An opaque object representing a pattern of image, canvas, or video.</p> <p>Created by calling <code>createPattern</code> on a <code>CanvasRenderingContext2D</code> object.</p> <p>Example usage:</p> <pre><code>var canvas = new CanvasElement(width: 600, height: 600); var ctx = canvas.context2D; var img = new ImageElement(); // Image src needs to be loaded before pattern is applied. img.onLoad.listen((event) {   // When the image is loaded, create a pattern   // from the ImageElement.   CanvasPattern pattern = ctx.createPattern(img, 'repeat');   ctx.rect(0, 0, canvas.width, canvas.height);   ctx.fillStyle = pattern;   ctx.fill(); }); img.src = \"images/foo.jpg\"; document.body.children.add(canvas); </code></pre> <p>See also: <em> <a href=\"https://developer.mozilla.org/en-US/docs/DOM/CanvasPattern\">CanvasPattern</a> from MDN. </em> <a href=\"http://www.whatwg.org/specs/web-apps/current-work/multipage/the-canvas-element.html#canvaspattern\">CanvasPattern</a> from whatwg. * <a href=\"http://www.w3.org/TR/2010/WD-2dcontext-20100304/#canvaspattern\">CanvasPattern</a> from W3C.</p>"
