  "CanvasGradient" : 
    "name" : "CanvasGradient"
    "qualifiedname" : "dart.dom.html.CanvasGradient"
    "comment" : "<p>An opaque canvas object representing a gradient.</p> <p>Created by calling <code>createLinearGradient</code> or <code>createRadialGradient</code> on a <code>CanvasRenderingContext2D</code> object.</p> <p>Example usage:</p> <pre><code>var canvas = new CanvasElement(width: 600, height: 600); var ctx = canvas.context2D; ctx.clearRect(0, 0, 600, 600); ctx.save(); // Create radial gradient. CanvasGradient gradient = ctx.createRadialGradient(0, 0, 0, 0, 0, 600); gradient.addColorStop(0, '#000'); gradient.addColorStop(1, 'rgb(255, 255, 255)'); // Assign gradients to fill. ctx.fillStyle = gradient; // Draw a rectangle with a gradient fill. ctx.fillRect(0, 0, 600, 600); ctx.save(); document.body.children.add(canvas); </code></pre> <p>See also:</p><ul><li><a href=\"https://developer.mozilla.org/en-US/docs/DOM/CanvasGradient\">CanvasGradient</a> from MDN.</li><li><a href=\"http://www.whatwg.org/specs/web-apps/current-work/multipage/the-canvas-element.html#canvasgradient\">CanvasGradient</a> from whatwg.</li><li><a href=\"http://www.w3.org/TR/2010/WD-2dcontext-20100304/#canvasgradient\">CanvasGradient</a> from W3C.</li></ul>"
