      "toDataUrl" : 
        "name" : "toDataUrl"
        "qualifiedname" : "dart.dom.html.CanvasElement.toDataUrl"
        "comment" : "<p>Returns a data URI containing a representation of the image in the format specified by type (defaults to 'image/png').</p> <p>Data Uri format is as follow <code>data:[&lt;MIME-type&gt;][;charset=&lt;encoding&gt;][;base64],&lt;data&gt;</code></p> <p>Optional parameter <code>quality</code> in the range of 0.0 and 1.0 can be used when requesting <code>type</code> 'image/jpeg' or 'image/webp'. If <code>quality</code> is not passed the default value is used. Note: the default value varies by browser.</p> <p>If the height or width of this canvas element is 0, then 'data:' is returned, representing no data.</p> <p>If the type requested is not 'image/png', and the returned value is 'data:image/png', then the requested type is not supported.</p> <p>Example usage:</p> <pre><code>CanvasElement canvas = new CanvasElement(); var ctx = canvas.context2D ..fillStyle = \"rgb(200,0,0)\" ..fillRect(10, 10, 55, 50); var dataUrl = canvas.toDataUrl(\"image/jpeg\", 0.95); // The Data Uri would look similar to // 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUA // AAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO // 9TXL0Y4OHwAAAABJRU5ErkJggg==' //Create a new image element from the data URI. var img = new ImageElement(); img.src = dataUrl; document.body.children.add(img); </code></pre> <p>See also:</p><ul><li> <p><a href=\"http://en.wikipedia.org/wiki/Data_URI_scheme\">Data URI Scheme</a> from Wikipedia.</p></li><li> <p><a href=\"https://developer.mozilla.org/en-US/docs/DOM/HTMLCanvasElement\">HTMLCanvasElement</a> from MDN.</p></li><li> <p><a href=\"http://dev.w3.org/html5/spec/the-canvas-element.html#dom-canvas-todataurl\">toDataUrl</a> from W3C.</p></li></ul>"
